description:
Harley Dean decides that she's done enough hiking and breaks off from her friends in order to return to the cabin where her friend's brother is hanging out. She starts chit chatting with him and confesses that she has always found him attractive, but she never acted on any impulse because he's her friend's brother. He confesses that he's always found her attractive too. Since they are alone, for the time being, they decide to act on their impulses and fuck..


